Description:
Claremont senior fellow and a high-level Trump State Department appointee; 

It was Anton more than any other single figure who connected the Claremont Institute to MAGA and the alt-right. His 2016 Claremont Review of Books article “The Flight 93 Election”—using the metaphor of the passengers who rushed the cockpit on the terrorist flight on September 11, 2001—was to go viral and played a major role in mobilizing militant support for the Trump campaign. Here Anton declared that the 2016 election was a “charge the cockpit or die election,” in which “you may die anyway” in the attempt, but if Hillary Clinton were to be elected, “death is certain."

Anton’s The Stakes, however, is best known for his explicit advocacy of a “red [that is, Republican or right-wing] Caesarism,” in which the presidency would become a “form of absolute monarchy” or “one-man rule” exhibiting widespread popular support—a position that was followed immediately after in his book with the exhortation to “reelect Trump!” Only when elected would Trump declare himself Caesar.26
